B.a3f=new A.Cg("#### **BASES LEGALES PARA EL SISTEMA DE ATENCI\xd3N AL CIUDADANO**\n---\n\n#### **1. CONSTITUCI\xd3N DE LA REP\xdaBLICA BOLIVARIANA DE VENEZUELA.**\n##### **G.O.R.B.V N\xb0 36.860 de fecha 30 de diciembre de 1.999.**\n\n\n**Cap\xedtulo III. De los Derechos Civiles**\n\n**_Art\xedculo 51._**\nToda persona tiene el derecho de representar o dirigir peticiones ante cualquier\nautoridad, funcionario p\xfablico o funcionaria p\xfablica sobre los asuntos que sean de\nla competencia de \xe9stos o \xe9stas, y de obtener oportuna y adecuada respuesta.\nQuienes violen este derecho ser\xe1n sancionados o sancionadas conforme a la ley,\npudiendo ser destituidos o destituidas del cargo respectivo.\n\n\n#### **T\xcdTULO IV. DEL PODER P\xdaBLICO**\n**Cap\xedtulo I. Secci\xf3n Segunda: De la Administraci\xf3n P\xfablica**\n\n**_Art\xedculo 141._**\n\nLa Administraci\xf3n P\xfablica est\xe1 al servicio de los ciudadanos y ciudadanas y se\nfundamenta en los principios de honestidad, participaci\xf3n, celeridad, eficacia,\neficiencia, transparencia, rendici\xf3n de cuentas y responsabilidad en el ejercicio de\nla funci\xf3n p\xfablica, con sometimiento pleno a la ley y al derecho.\n\n#### **2. LEY ORG\xc1NICA DE LA ADMINISTRACI\xd3N P\xdaBLICA.**\n##### **G.O.R.B.V N\xb0 37.305 de fecha 17 de octubre de 2001.**\n\n**_Art\xedculo 3. Objetivo de la Administraci\xf3n P\xfablica_**\n\nLa Administraci\xf3n P\xfablica tendr\xe1 como objetivo de su organizaci\xf3n y\nfuncionamiento hacer efectivos los principios, valores y normas consagrados en la\nConstituci\xf3n de la Rep\xfablica Bolivariana de Venezuela y en especial, garantizar a\ntodas las personas, el goce y ejercicio de los derechos humanos.\n\n\n**_Art\xedculo 5. Principio de la Administraci\xf3n P\xfablica al servicio de las personas_**\n\nLa Administraci\xf3n P\xfablica est\xe1 al servicio de las personas, y su actuaci\xf3n estar\xe1\ndirigida a la atenci\xf3n de sus requerimientos y la satisfacci\xf3n de sus necesidades,\nbrindando especial atenci\xf3n a las de car\xe1cter social.\n\n\nLa Administraci\xf3n P\xfablica debe asegurar a todas las personas la efectividad de\nsus derechos cuando se relacionen con ella.\n\n\nAdem\xe1s, tendr\xe1 entre sus objetivos la continua mejora de los procedimientos,\nservicios y prestaciones p\xfablicas, de acuerdo con las pol\xedticas que se dicten.\n\n\n**_Art\xedculo 6. Garant\xedas que debe ofrecer la Administraci\xf3n P\xfablica a las\npersonas._**\n\nLa Administraci\xf3n P\xfablica desarrollar\xe1 su actividad y se organizar\xe1 de manera que\nlas personas puedan:\n\n1. Resolver sus asuntos, ser auxiliadas en la redacci\xf3n formal de documentos\nadministrativos; y recibir informaci\xf3n de su inter\xe9s por cualquier medio escrito,\noral, telef\xf3nico, electr\xf3nico e inform\xe1tico;\n2. Presentar reclamaciones sobre el funcionamiento de la Administraci\xf3n P\xfablica;\n3. Acceder f\xe1cilmente a informaci\xf3n actualizada sobre el esquema de organizaci\xf3n\nde los \xf3rganos y entes de la Administraci\xf3n P\xfablica, as\xed como a gu\xedas informativas\nsobre los procedimientos administrativos, servicios y prestaciones que ellos\nofrecen.\n\n\n#### **3. LEY ORG\xc1NICA DE PROCEDIMIENTOS ADMINISTRATIVOS**\n##### **G.O.R.V N\xba 2.818 Extraordinaria de 1\xba de julio de 1981.**\n\n**_Art\xedculo 3._**\nLos funcionarios y dem\xe1s personas que presten servicios en la administraci\xf3n\np\xfablica, est\xe1n en la obligaci\xf3n de tramitar los asuntos cuyo conocimiento les\ncorresponda y son responsables por las faltas en que incurran.\n\nLos interesados podr\xe1n reclamar, ante el superior jer\xe1rquico inmediato, del\nretardo, omisi\xf3n, distorsi\xf3n o incumplimiento de cualquier procedimiento, tr\xe1mite o\nplazo, en que incurrieren los funcionarios responsables del asunto.\n\nEste reclamo deber\xe1 interponerse en forma escrita y razonada y ser\xe1 resuelto\ndentro de los quince (15) d\xedas siguientes. La reclamaci\xf3n no acarrear\xe1 la\nparalizaci\xf3n del procedimiento, ni obstaculizar\xe1 la posibilidad de que sean\nsubsanadas las fallas u omisiones. Si el superior jer\xe1rquico encontrare fundado el\nreclamo, impondr\xe1 al infractor o infractores la sanci\xf3n prevista en el art\xedculo 100\nde la presente Ley sin perjuicio de las dem\xe1s responsabilidades y sanciones a que\nhubiere lugar.\n\n\n#### **4. LEY ORG\xc1NICA DE LA CONTRALOR\xcdA GENERAL DE LA REP\xdaBLICA.**\n##### **G.O.R.B.V N\xb0 6.013 Extraordinario del 23 de diciembre de 2010.**\n\n**_Art\xedculo 25. Numeral 7_**\nEl Sistema Nacional de Control Fiscal se regir\xe1 por los siguientes principios:\n\u20267. La participaci\xf3n de la ciudadan\xeda en la gesti\xf3n contralora.\n\n\n**Cap\xedtulo VIII De la participaci\xf3n ciudadana**\n**_Art\xedculo 75._**\nEl Contralor o Contralora General de la Rep\xfablica, mediante resoluci\xf3n que se\npublicar\xe1 en la Gaceta Oficial de la Rep\xfablica Bolivariana de Venezuela, dictar\xe1\nlas normas destinadas a fomentar la participaci\xf3n de los ciudadanos y ciudadanas,\nhaciendo especial \xe9nfasis en los siguientes aspectos:\n\n\u20262. Ordenar, dirigir, sistematizar y evaluar las denuncias ciudadanas que\nprovengan de las instancias que ejercen la contralor\xeda social.\n\n\n**_Art\xedculo 96._**\nSi como consecuencia del ejercicio de las funciones de control o de las potestades\ninvestigativas establecidas en esta Ley, surgieren elementos de convicci\xf3n o\nprueba que pudieran dar lugar a la formulaci\xf3n de reparos, a la declaratoria de\nresponsabilidad administrativa o a la imposici\xf3n de multas, el \xf3rgano de control\nfiscal respectivo iniciar\xe1 el procedimiento mediante auto motivado que se notificar\xe1\na los interesados o interesadas , seg\xfan lo previsto en la Ley Org\xe1nica de\nProcedimientos Administrativos.\n\n#### **5. LEY DE INFOGOBIERNO**\n##### **G.O.R.B.V N\xba 37.313 30 de octubre de 2001**\n\n**_Art\xedculo 8. Numeral 8. Derecho de las personas._**\nEn las relaciones con el Poder P\xfablico y el Poder Popular, las personas tienen\nderecho a:\n\n\u20268. Disponer de mecanismos que permitan el ejercicio de la contralor\xeda social\nhaciendo uso de las tecnolog\xedas de informaci\xf3n.\n\n**_Art\xedculo 14. Principio de accesibilidad_**\n\nEl Poder P\xfablico, en forma corresponsable con el Poder Popular, participa en el\ndesarrollo, implementaci\xf3n y uso de las tecnolog\xedas de informaci\xf3n libres, a fin de\ngarantizar a las personas, en igualdad de condiciones, el acceso y la apropiaci\xf3n\nsocial del conocimiento asociado a esas tecnolog\xedas.\n\n**_Art\xedculo 20. Derecho a la participaci\xf3n en la promoci\xf3n de los servicios y\nuso de las tecnolog\xedas de informaci\xf3n._**\nEl Poder P\xfablico y el Poder Popular est\xe1n obligados a garantizar en sus portales\nde internet el ejercicio del derecho de las personas a participar, colaborar y\npromover el uso de las tecnolog\xedas de informaci\xf3n libres, creaci\xf3n de nuevos\nservicios electr\xf3nicos o mejoramiento de los ya existentes.\n\n**_Art\xedculo 21. Mecanismos de ejercicio de contralor\xeda social._**\nLos servicios prestados por el Poder P\xfablico y el Poder Popular deben contener\nmecanismos que permitan la promoci\xf3n, desarrollo y consolidaci\xf3n de la\ncontralor\xeda social como medio de participaci\xf3n de las personas y sus\norganizaciones sociales, para garantizar que la inversi\xf3n p\xfablica se realice de\nmanera transparente y eficiente, en beneficio de los intereses de la sociedad y que\nlas actividades del sector privado no afecten los intereses colectivos o sociales.\n\n#### **6. LEY DE SIMPLIFICACI\xd3N DE TR\xc1MITES ADMINISTRATIVOS.**\n##### **G.O.R.B.V N\xb0 40.549, de fecha 26 de noviembre de 2014**\n\n**_Art\xedculo 36._**\n\nLas funcionarias o funcionarios p\xfablicos, las trabajadoras y trabajadores de la\nAdministraci\xf3n P\xfablica y, en general, quienes en cualquier situaci\xf3n de empleo\np\xfablico deban prestar un servicio a las personas con ocasi\xf3n del cumplimiento de\nun tr\xe1mite administrativo, ser\xe1n considerados servidoras y servidores p\xfablicos a\nlos fines del presente Decreto con Rango, Valor y Fuerza de Ley, obligados a\nprocurar la mayor eficiencia y la m\xe1s esmerada y amable atenci\xf3n a todas\naquellas personas que realizan tr\xe1mites ante la Administraci\xf3n P\xfablica, en los\ncuales se requiera su concurso.\n\n**_Art\xedculo 38._**\n\nLos \xf3rganos y entes de la Administraci\xf3n P\xfablica, tienen el deber de ofrecer a las\npersonas informaci\xf3n completa, oportuna y veraz en relaci\xf3n con los tr\xe1mites que\nse realicen ante los mismos. La Administraci\xf3n P\xfablica dar\xe1 preferencia al uso de\ntecnolog\xedas de informaci\xf3n, por medios de acceso remoto, a los fines de mantener\ninformado al interesado sobre las resultas, el estado y dem\xe1s notificaciones\nrelacionados con el tr\xe1mite de su inter\xe9s. Los \xf3rganos y entes de la Administraci\xf3n\nP\xfablica, deber\xe1n tener disponibles en sus sitios de Internet, v\xednculos que permitan\na los interesados acceder a informaci\xf3n sobre sus tr\xe1mites. Adicionalmente, en las\noficinas y establecimientos en los cuales se d\xe9 inicio a cualesquiera tr\xe1mites\nadministrativos, la m\xe1xima autoridad de dicha oficina o establecimiento ser\xe1\nresponsable de la fijaci\xf3n en sitio visible al p\xfablico de los requisitos exigidos para\ncada tr\xe1mite, las oficinas que intervienen y su ubicaci\xf3n, la identificaci\xf3n del\nfuncionario responsable del tr\xe1mite, su duraci\xf3n aproximada, los derechos de las\npersonas en relaci\xf3n con el tr\xe1mite o servicio en cuesti\xf3n y la forma en que se\npueden dirigir sus quejas, reclamos y sugerencias. Esta informaci\xf3n se publicar\xe1\nadem\xe1s mediante gu\xedas simples de consulta p\xfablica, suministradas en forma\ngratuita, y deber\xe1 d\xe1rseles la publicidad necesaria a trav\xe9s de cualquier medio de\ncomunicaci\xf3n, entre otros, visual, oral, escrito, inform\xe1tico o telem\xe1tico.\n\n**_Art\xedculo 41. Servicio de atenci\xf3n al p\xfablico._**\n\nCada uno de los \xf3rganos y entes de la Administraci\xf3n P\xfablica deber\xe1 crear un\nservicio de atenci\xf3n al p\xfablico, encargado de brindar toda la orientaci\xf3n y apoyo\nnecesario a las personas en relaci\xf3n con los tr\xe1mites que se realicen ante ellos,\nprestar servicios de recepci\xf3n y entrega de documentos, solicitudes y\nrequerimientos en general, as\xed como recibir y procesar las denuncias, sugerencias\ny quejas que, en torno al servicio y a la actividad administrativa se formulen.\nDichos servicios de atenci\xf3n al p\xfablico estar\xe1n bajo la supervisi\xf3n de la autoridad\nnacional unificada en materia de tr\xe1mites administrativos, la cual podr\xe1 dictar\nregulaciones especiales sobre su funcionamiento, de obligatorio cumplimiento\npara todos los \xf3rganos y entes de la Administraci\xf3n P\xfablica. Los \xf3rganos y entes\nde la Administraci\xf3n P\xfablica, incluso de distintos Poderes P\xfablicos o distintas\nentidades o unidades pol\xedtico territoriales, podr\xe1n suscribir encomiendas\nconvenidas mediante las cuales acuerden la gesti\xf3n conjunta de varios tr\xe1mites,\nde manera parcial o total. En estas encomiendas convenidas podr\xe1n disponer el\nfuncionamiento de varios organismos en una sola oficina, establecimiento, taquilla\no ventanilla de atenci\xf3n, pudiendo establecer acuerdos especiales referidos al\npago de determinados gastos de manera conjunta, indicando expresamente el\nporcentaje o la clase de gastos que corresponder\xe1 a cada \xf3rgano o ente.\n\n#### **7. LEY PARA EL RESPETO DE LOS DERECHOS HUMANOS EN EL EJERCICIO DE LA FUNCI\xd3N P\xdaBLICA.**\n##### **G.O.R.B.V N\xb0 6.658 Extraordinario 28 de octubre de 2021**\n\n**_Art\xedculo 1._**\n \nEsta Ley tiene por objeto establecer los principios fundamentales y\nnormas generales que permitan fortalecer el respeto, garant\xeda y protecci\xf3n de los\nderechos humanos en el ejercicio de la funci\xf3n p\xfablica.\n\n\n#### **8. LEY DE REFORMA DEL DECRETO CON RANGO, VALOR Y FUERZA DE LEY CONTRA LA CORRUPCI\xd3N.**\n##### **G.O.R.B.V N\xba N\xb0 6.699 Extraordinario 2 de mayo de 2022**\n\n**_Art\xedculo 86. Alardeamiento o valimiento de relaciones o influencias._**\n\nLa persona que alardeando de valimiento o de relaciones de importancia e\ninfluencia con cualquier funcionaria p\xfablica o funcionario p\xfablico reciba o se haga\nprometer, para s\xed o para otro, dinero o cualquier otra utilidad, bien como est\xedmulo o\nrecompensa de su mediaci\xf3n, bien so pretexto de remunerar el logro de favores,\nser\xe1 penada o penado con prisi\xf3n de dos (2) a siete (7) a\xf1os; y con prisi\xf3n de seis\n(6) meses a dos (2) a\xf1os, a quien d\xe9 o prometa el dinero o cualquier otra utilidad\nde las que se indican en este art\xedculo, a menos que haya denunciado el hecho\nante la autoridad competente antes de la iniciaci\xf3n del correspondiente proceso\njudicial.\n\n\n**_Art\xedculo 89. Denuncia o acusaci\xf3n falsa_**\n\nCualquiera que falsamente denunciare o acusare a otra persona de la comisi\xf3n de\nalguno o algunos de los hechos punibles previstos en esta Ley, ser\xe1 castigada con\nprisi\xf3n de uno (1) a tres (3) a\xf1os.\n\n\n**_Art\xedculo 90. Promesa de soborno a funcionaria p\xfablica o funcionario p\xfablico._**\n\nQuien por s\xed o por persona interpuesta prometa, ofrezca u otorgue a una\nfuncionaria p\xfablica o funcionario p\xfablico de otro Estado, directa o indirectamente,\npor parte de sus nacionales, personas que tengan residencia habitual en su\nterritorio y empresas domiciliadas en \xe9l, cualquier objeto de valor pecuniario u\notros beneficios, como d\xe1divas, favores, promesas, ventajas a cambio de que\ndicha funcionaria o funcionario realice u omita cualquier acto, en el ejercicio de sus\nfunciones p\xfablicas, relacionado con una transacci\xf3n de naturaleza econ\xf3mica,\ncomercial o de cualquier otra \xedndole, ser\xe1 penada o penado con prisi\xf3n de seis (6)\na doce (12) a\xf1os.\n\n\n#### **9. C\xd3DIGO DE CONDUCTA DE LOS SERVIDORES P\xdaBLICOS.**\n##### **G.O.R.V N\xb0 36.496 de fecha 15 de julio de 1998**\n\n\n**T\xcdTULO II PRINCIPIOS \xc9TICOS DEL SERVIDOR P\xdaBLICO**\n\n**_Art\xedculo 3._**\n\nA los efectos de este C\xf3digo son principios rectores de los deberes y conductas\nde los servidores p\xfablicos respecto a los valores \xe9ticos que han de regir la funci\xf3n\np\xfablica: a) La honestidad. b) La equidad. c) El decoro. d) La lealtad. e) La\nvocaci\xf3n de servicio. f) La disciplina. g) La eficacia. h) La responsabilidad. i) La\npuntualidad. j) La transparencia k) La pulcritud.\n\n\n#### **10. C\xd3DIGO DE \xc9TICA PARA EL FUNCIONARIO P\xdaBLICO**\n##### **G.O.R.V N\xba 36.268 del mi\xe9rcoles 13 de agosto de 1997**\n\n**_Art\xedculo 1._**\n\nCorresponde a los funcionarios p\xfablicos:\n\n1. Salvaguardar en todo momento y en cada una de sus actuaciones, los intereses\ngenerales del Estado y en la preservaci\xf3n del patrimonio p\xfablico.\n2. Actuar con estricto apego a las leyes y a todas las dem\xe1s normas e\ninstrucciones que deben regir su comportamiento en la realizaci\xf3n cabal de todas\nlas tareas que tenga asignadas.\n3. Dedicar todos sus esfuerzos para cumplir, con la m\xe1xima eficiencia y la m\xe1s\nalta\neficacia, la misi\xf3n que le est\xe9 encomendada.\n4. Realizar permanentemente actividades de superaci\xf3n personal y de\ncolaboraci\xf3n en el mejoramiento institucional de la administraci\xf3n p\xfablica y, en\nparticular, del organismo donde preste sus servicios.\n5. Rehusar con firmeza inequ\xedvoca el mantenimiento de relaciones o de intereses,\ncon personas u organizaciones, que sean incompatibles con sus cargos y con las\natribuciones y funciones que le est\xe9n asignadas.\n6. Proceder con objetividad e imparcialidad en todas las decisiones que le\ncorresponda tomar y en los asuntos en los que deba intervenir.\n7. Rechazar en cualquier caso y circunstancia y no solicitar jam\xe1s, ni para s\xed\nmismos ni para terceros, pagos, beneficios o privilegios en ocasi\xf3n de los servicios\nque deba prestar.\n8. Ajustar su conducta, de modo estricto y sin excepciones, a favor de la\ntransparencia en la administraci\xf3n p\xfablica manteniendo la confidencialidad y\nreserva de informaci\xf3n en aquellos casos excepcionales cuya divulgaci\xf3n est\xe9\nprohibida, por razones del superior inter\xe9s p\xfablico, de modo expreso y temporal.\n9. Denunciar ante la autoridad competente y rechazar cualquier actividad contraria\nal correcto manejo de los fondos y del inter\xe9s p\xfablico.\n10. Tratar a los ciudadanos y a los funcionarios p\xfablicos con absoluto respeto y\ncon apego a la estricta legalidad, prest\xe1ndole sus servicios y colaboraci\xf3n de\nmanera eficiente, puntual y pertinente, sin abusar en modo alguno de la autoridad\ny atribuciones que le sean conferidas en ocasi\xf3n del cargo que desempe\xf1e.\n\n#### **11. DECRETO SOBRE ORGANIZACI\xd3N GENERAL DE LA ADMINISTRACI\xd3N P\xdaBLICA NACIONAL Decreto N\xb0 2.378.**\n##### **G.O.R.B.V N\xb0 6.238 Extraordinario del 13 de julio de 2016**\n\n**_Art\xedculo 22. Las Oficinas de Atenci\xf3n Ciudadana_**\n\n\n\u20261. Asesorar y atender a los ciudadanos, ciudadanas y comunidades organizadas\nque acudan a la Oficina a interponer denuncias, quejas, reclamos, sugerencias o\npeticiones, en relaci\xf3n a los tr\xe1mites y servicios que presta el Ministerio, en\narticulaci\xf3n con las unidades o dependencias administrativas u \xf3rganos p\xfablicos o\nentidades privadas con competencia en la materia, seg\xfan sea el caso.\n\n\n\u20265. Gestionar y hacer seguimiento a las atenciones dadas en esta Oficina, as\xed\ncomo emitir informaci\xf3n oportuna sobre el estado o curso de la solicitud o tr\xe1mite\ninterpuesto y el plazo dentro del cual se dar\xe1 respuesta.\n\n\n\u20267. Participar en las actividades relativas a la atenci\xf3n de la ciudadan\xeda\n\n#### **12. NORMAS PARA FOMENTAR LA PARTICIPACI\xd3N CIUDADANA**\n##### **G.O.R.V N\xb0 38.750 de fecha 20 de agosto de 2007**\n\n**_Art\xedculo 5._**\n\nPrincipios y valores que regulan la participaci\xf3n ciudadana\nLa participaci\xf3n de los ciudadanos en el ejercicio del control sobre la gesti\xf3n\np\xfablica, se regir\xe1 por los principios de corresponsabilidad, rendici\xf3n de cuentas,\nhonestidad, eficiencia y eficacia, sobre la base de los valores de la vida, la libertad,\nla igualdad, la justicia, la paz, la solidaridad, el bien com\xfan, el imperio de la Ley, la\n\xe9tica, el pluralismo pol\xedtico y la preeminencia de los derechos humanos.\n\n**_Art\xedculo 9._**\n\nInterposici\xf3n de denuncias, quejas, reclamos, sugerencias o peticiones\nLos ciudadanos de forma individual o colectiva, directamente o por medio de sus\nrepresentantes elegidos, o a trav\xe9s de la comunidad organizada, podr\xe1n presentar\nante la Oficina de Atenci\xf3n Ciudadana denuncias, quejas, reclamos, sugerencias o\npeticiones.\n\n**_Art\xedculo 10._**\n\nEl servicio de atenci\xf3n a la ciudadan\xeda se prestar\xe1, fundamentalmente, por la\nOficina de Atenci\xf3n Ciudadana, que de conformidad con lo previsto en el art\xedculo 9\nde la Ley Contra la Corrupci\xf3n deben crear los organismos y entidades a que se\nrefieren los numerales 1 al 11 del art\xedculo 9 de la Ley Org\xe1nica de la Contralor\xeda\nGeneral de la Rep\xfablica y del Sistema Nacional de Control Fiscal.\n\n\n**_Art\xedculo 12._**\n\nEl objetivo de la Oficina de Atenci\xf3n Ciudadana es promover la participaci\xf3n\nciudadana; suministrar y ofrecer de forma oportuna, adecuada y efectiva, la\ninformaci\xf3n requerida; apoyar, orientar, recibir y tramitar denuncias, quejas,\nreclamos, sugerencias y peticiones; y en general, resolver las solicitudes\nformuladas por los ciudadanos.\n\n\n**_Art\xedculo 13._**\n\nLas m\xe1ximas autoridades jer\xe1rquicas de los organismos y entidades a que se\nrefieren los numerales 1 al 11 del art\xedculo 9 de la Ley Org\xe1nica de la Contralor\xeda\nGeneral de la Rep\xfablica y del Sistema Nacional de Control Fiscal, establecer\xe1n las\nfunciones de la Oficina de Atenci\xf3n Ciudadana, de conformidad con el\nordenamiento jur\xeddico que los regula y las presentes Normas.\n\nA las Oficinas de Atenci\xf3n Ciudadana les corresponder\xe1, fundamentalmente:\n1. Atender, orientar, apoyar y asesorar a los ciudadanos que acudan a solicitar\ninformaci\xf3n, requerir documentos o interponer denuncias, quejas, reclamos,\nsugerencias o peticiones.\n2. Informar a la ciudadan\xeda sobre la utilizaci\xf3n de los recursos que integran el\npatrimonio p\xfablico del ente u organismo, a trav\xe9s de un informe, de f\xe1cil manejo y\ncomprensi\xf3n, que se publicar\xe1 trimestralmente y se pondr\xe1 a disposici\xf3n de\ncualquier persona.\n3. Poner a disposici\xf3n de la ciudadan\xeda la informaci\xf3n relativa a la estructura\norganizativa y funciones del respectivo ente u organismo y de sus \xf3rganos\nadscritos, y sobre los procedimientos administrativos y servicios que presta, a\ntrav\xe9s de medios impresos, audiovisuales, inform\xe1ticos, entre otros.\n4. Recibir, tramitar, valorar, decidir o resolver, denuncias, quejas, reclamos,\nsugerencias o peticiones y remitirlas a la dependencia de la organizaci\xf3n o al ente\nu organismo que tenga competencia para conocerlas, seg\xfan el caso.\n5. Llevar un registro automatizado de las denuncias, quejas, reclamos,\nsugerencias y peticiones.\n6. Comunicar a los ciudadanos la decisi\xf3n o respuesta de las denuncias, quejas,\nreclamos, sugerencias y peticiones formuladas por ellos.\n7. Promover la participaci\xf3n ciudadana.\n8. Llevar el registro de las comunidades organizadas y de las organizaciones\np\xfablicas no estatales a que hace menci\xf3n el art\xedculo 135 de la Ley Org\xe1nica de la\nAdministraci\xf3n P\xfablica.\n9. Formar y capacitar a la comunidad en los aspectos vinculados con el ejercicio\ndel derecho a la participaci\xf3n ciudadana en el control de la gesti\xf3n p\xfablica\nmediante talleres, foros o seminarios, entre otros.\n10. Atender las iniciativas de la comunidad vinculadas con el ejercicio de la\nparticipaci\xf3n ciudadana en el control de la gesti\xf3n p\xfablica.\n11. Las dem\xe1s competencias que le sean asignadas.\n\n**Secci\xf3n II.**\n\n**De la Tramitaci\xf3n de las Denuncias, Quejas, Reclamos, Sugerencias y\nPeticiones.**\n\n**_Art\xedculo 15._**\n\n\nLa Oficina de Atenci\xf3n Ciudadana determinar\xe1 si el organismo o entidad tiene\ncompetencia para tramitar la denuncia, la queja, reclamo, sugerencia o petici\xf3n\npresentada.\n\n\nEn caso de determinar que el organismo o entidad es competente para resolver la\ndenuncia, queja, reclamo, sugerencia o petici\xf3n, indicar\xe1 al ciudadano que su\nsolicitud se tramitar\xe1 en la organizaci\xf3n y que se le informar\xe1 sobre las resultas.\nEn caso de determinar que el organismo o entidad no es competente para resolver\nla denuncia, queja, reclamo, sugerencia o petici\xf3n, la remitir\xe1 al \xf3rgano o entidad\ncompetente e informar\xe1 al ciudadano sobre dicha remisi\xf3n.\n\n\nDe la normativa transcrita tenemos que los t\xe9rminos aplicables a los efectos del\nsistema a aplicar son Denuncias, Quejas, Reclamos, Sugerencias y Peticiones.\n\n\n**1. DENUNCIA 1** : Vinculadas con la comisi\xf3n de actos, hechos u omisiones\n1 Normas para Fomentar la Participaci\xf3n Ciudadana, art\xedculos 17 y 20\ncontrarios a una disposici\xf3n legal o sublegal relacionados con la\nadministraci\xf3n, manejo o custodia de fondos o bienes p\xfablicos, la Oficina\nde Atenci\xf3n Ciudadana las remitir\xe1 al \xf3rgano de control fiscal competente,\npara que ejerza las acciones fiscales. Asimismo, informara a la autoridad a\nquien corresponda adoptar las medidas inmediatas tendentes a impedir o\ncorregir las deficiencias denunciadas o la producci\xf3n de da\xf1o al patrimonio\np\xfablico, de ser el caso, preservado en todo momento la identidad del\ndenunciante.\nLas denuncias podr\xe1n formularse por escrito, firmadas en original;\nverbalmente o a trav\xe9s de medios electr\xf3nicos y deber\xe1n contener la\nidentificaci\xf3n del denunciante, la narraci\xf3n circunstanciada de los actos,\nhechos u omisiones presuntamente irregulares, el se\xf1alamiento de quienes\nlo han cometido, fecha de ocurrencia, ente u organismo donde ocurrieron y\ntodo cuanto le constare el denunciante.\n\n\n**2. QUEJA 2** : Es una articulaci\xf3n que puede tener o no contenido jur\xeddico y\npuede recaer sobre los servicios administrativos prestados por el sector\np\xfablico o sobre los servicios p\xfablicos prestados por personas p\xfablicas o\nprivadas, ambas modalidades en defensa de los derechos, garant\xedas e\nintereses de quienes las interponen.\n\n\n**3. RECLAMO 3**: Denota una inconformidad que una persona tiene con una\nsituaci\xf3n concreta, por lo general en el marco de un procedimiento\nadministrativo. Se trata de dirigirse a una autoridad administrativa o judicial\npara que \xe9sta reconozca un derecho.\n\n\n**4. SUGERENCIA**: Acto de proponer, recomendar, una idea o propuesta para\nmejorar la prestaci\xf3n de un servicio en la entidad.\n\n**5. PETICI\xd3N 4**: Se trata del escrito que se presenta ante una autoridad\ncompetente formulando una determinada solicitud o requerimiento. \n",null)
