B.a3e=new A.Cg("## **Datos de Ley**\n\n---\n\n\n**Raz\xf3n Social**: Instituto Nacional de los Espacio Acu\xe1ticos (INEA).\n\n**R.I.F.**: G-200021411.\n\n**Domicilio Principal**: Av. Orinoco entre Perij\xe1 y Mucuch\xedes, edificio INEA.\n\n\nA trav\xe9s de este documento, la aplicaci\xf3n **INEA Te Escucha** recoge su Pol\xedtica de\nPrivacidad.\n\n\nNos aseguramos de que los datos de car\xe1cter personal proporcionados por nuestros\nusuarios y potenciales usuario tengan la m\xe1xima reserva y protecci\xf3n.\nRespetamos la confidencialidad y privacidad de la informaci\xf3n suministradas por nuestros\nusuarios y de todas aquellas personas interesadas en los servicios y/o productos\nofrecidos a trav\xe9s de nuestra plataforma web.\n\n\n#### **Pol\xedtica de Privacidad para INEA Te Escucha**\n\nPara el INEA la pol\xedtica de privacidad tiene como objeto informar acerca de c\xf3mo\nrecopilamos, seguimos y compartimos su informaci\xf3n y de c\xf3mo nos comprometemos a\nla protecci\xf3n de sus datos. Esta informaci\xf3n es importante, esperamos que dedique el\ntiempo necesario a leerla. Su privacidad es muy importante para nosotros.\n\nLa pol\xedtica de privacidad puede ser modificada, ya sea por el uso de nuevas tecnolog\xedas\nde procesamiento de informaci\xf3n, o cambios que pudi\xe9ramos introducir en nuestra\naplicaci\xf3n y a nuestras herramientas de comunicaci\xf3n. Todas las veces que\nmodifiquemos esta pol\xedtica lo comunicaremos, de manera que pueda estar siempre al\ntanto de la misma. No limitaremos los derechos que le corresponden con arreglo a la\npresente pol\xedtica de privacidad sin su expreso consentimiento.\n\n\n#### **Confidencialidad del tratamiento de los datos personales**\n\nAseguramos la confidencialidad de los datos personales de los usuarios que se registren\nen la aplicaci\xf3n INEA Te Escucha mediante el formulario establecido para esos efectos.\nSin perjuicio de sus facultades legales, s\xf3lo efectuaremos tratamiento de datos\npersonales respecto a aquellos que han sido entregados voluntariamente por los usuarios\nen los referidos formularios.\n\n\n#### **Seguridad de su informaci\xf3n personal**\n\nSus datos personales le corresponden s\xf3lo a usted y INEA Te Escucha es responsable de\nno revelar ninguna clase de informaci\xf3n que le pertenezca. Para ello, se usan los\nsistemas m\xe1s avanzados y se actualizan constantemente para asegurar que no existan\naccesos no autorizados. Como excepci\xf3n s\xf3lo compartiremos sus datos personales por\nmotivos legales. En este caso, s\xf3lo si consideramos de buena fe que existe una\nnecesidad razonable de acceder a dichos datos o utilizarlos, ya sea para cumplir con\ncualquier legislaci\xf3n o normativa, o atender a requerimientos legales, para cumplir con\ninvestigaciones de posibles infracciones y para proteger los derechos de los usuarios en\nla medida exigida por la legislaci\xf3n aplicable.\n\n#### **Obtenci\xf3n de su informaci\xf3n**\n\nSus datos personales consignados en esta aplicaci\xf3n son suministrados por usted mismo,\nhaciendo uso entero de su libertad. La informaci\xf3n aqu\xed almacenada s\xf3lo comprende\ndatos b\xe1sicos ingresados mediante formularios de contacto u otros similares.\n\n\n#### **Uso de la informaci\xf3n recogida**\n\nLos datos personales de los usuarios ser\xe1n utilizados para el cumplimiento de los fines\nindicados en el formulario correspondiente y siempre dentro de la competencia y\natribuciones de INEA Te Escucha, conectar con las gerencias u oficinas del INEA que\ndebe atender cada caso. Al proporcionarnos sus datos personales, estando de acuerdo\ncon la pol\xedtica de privacidad aqu\xed consignada, nos autoriza para el siguiente uso y\ntratamiento de su informaci\xf3n:\n\n1. Proporcionar nuestros productos, lo que incluye la actualizaci\xf3n, protecci\xf3n y\nsoluci\xf3n de problemas, as\xed como facilitar mejoras en nuestros procesos internos.\nTambi\xe9n incluye compartir datos, cuando sea necesario para proporcionar el\nservicio o realizar las transacciones que solicite.\n2. Para el fin mismo por lo cual se ha suministrado;\n3. Para considerarlo dentro de nuestras estad\xedsticas de tr\xe1fico, informaci\xf3n\nestad\xedstica elaborada a partir de los datos personales de los usuarios, sin el\nconsentimiento expreso del titular, aunque de dichos datos no sea posible\nidentificar individualmente a los titulares y;\n4. Para orientar mejor los servicios aqu\xed ofrecidos y valorarlos a su criterio.\n\n\n#### **Lo que el usuario deber\xeda saber de un vistazo**\n\nLa aplicaci\xf3n solo est\xe1 destinada atender las quejas y reclamos, sugerencias, denuncias y\nla alertar de una emergencia de embarcaci\xf3n.\n\nLa utilizaci\xf3n de la aplicaci\xf3n est\xe1 restringida en funci\xf3n de la edad: para acceder a INEA\nTe Escucha y utilizarlos es preciso ser mayor de edad seg\xfan la ley aplicable.\n\nAnte cualquier solicitud o denuncia el instituto se comunicar\xe1 con el usuario a trav\xe9s de\nlos datos proporcionado al momento del registro, en tal sentido se le recomienda colocar\nlos datos fidedignos, para as\xed contactarlo y atenderlo de manera directa.\n\nNi la aplicaci\xf3n ni el Instituto le solicitar\xe1 por correo o por ninguna v\xeda, datos personales\ntales como claves o informaci\xf3n privada.\n\n\n#### **Condiciones de Uso**\n\nLas condiciones de uso detalladas se aplicar\xe1n de forma general al uso de la aplicaci\xf3n.\nAl utilizar INEA Te Escucha, los usuarios confirman que cumplen los siguientes requisitos.\n\n- Los usuarios deber\xe1n entrar en la categor\xeda de denunciante.\n- Los usuarios deber\xe1n ser mayores de edad de acuerdo con la ley.\n\n\n#### **Registro en la Aplicaci\xf3n**\n\nPara utilizar la aplicaci\xf3n se deber\xe1n registrar, facilitando todos los datos o la informaci\xf3n\nexigidos de forma completa y fidedigna. En caso de no hacerlo la aplicaci\xf3n no le\npermitir\xe1 realizar ninguna solicitud.\n\n\nLos usuarios son responsables de la custodia de sus credenciales de acceso con\ngarant\xedas de confidencialidad y seguridad.\n\n\nAl registrarse, los usuarios acuerdan asumir plena responsabilidad por todas las\nactividades que tengan lugar bajo su nombre de usuario.\n",null)
